(18, 1, 'wp_yoast_notifications', 'a:3:{i:0;a:2:{s:7:"message";s:168:"Don\'t miss your crawl errors: <a href="http://lawyerdemo.1p21.io/wp-admin/admin.php?page=wpseo_search_console&tab=settings">connect with Google Search Console here</a>.";s:7:"options";a:9:{s:4:"type";s:7:"warning";s:2:"id";s:17:"wpseo-dismiss-gsc";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";s:14:"yoast_branding";b:0;}}i:1;a:2:{s:7:"message";s:328:"You still have the default WordPress tagline, even an empty one is probably better. <a href="http://lawyerdemo.1p21.io/wp-admin/customize.php?autofocus[control]=blogdescription&amp;url=http%3A%2F%2Fatt-directory-2.com%2Fwp-admin%2Ftools.php%3Fpage%3Dwp-migrate-db-pro%26wpmdb-profile%3D1">You can fix this in the customizer</a>.";s:7:"options";a:9:{s:4:"type";s:5:"error";s:2:"id";s:28:"wpseo-dismiss-tagline-notice";s:5:"nonce";N;s:8:"priority";d:0.5;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";s:14:"yoast_branding";b:0;}}i:2;a:2:{s:7:"message";s:222:"<strong>Huge SEO Issue: You\'re blocking access to robots.</strong> You must <a href="http://lawyerdemo.1p21.io/wp-admin/options-reading.php">go to your Reading Settings</a> and uncheck the box for Search Engine Visibility.";s:7:"options";a:9:{s:4:"type";s:5:"error";s:2:"id";s:32:"wpseo-dismiss-blog-public-notice";s:5:"nonce";N;s:8:"priority";i:1;s:9:"data_json";a:0:{}s:13:"dismissal_key";N;s:12:"capabilities";s:20:"wpseo_manage_options";s:16:"capability_check";s:3:"all";s:14:"yoast_branding";b:0;}}}'),
